import React from 'react'
import {Navbar, Nav, NavItem,Brand,Button,NavDropdown,Form,FormControl} from 'react-bootstrap';
import "./Navbar.css";


const NavbarTitle = ()=>{
    return <div>
        <div>
        <Navbar bg="light" variant="light" expand="lg">
                <Navbar.Brand >Todo na</Navbar.Brand>
                <Navbar.Toggle aria-controls="basic-navbar-nav" />
                <Navbar.Collapse id="basic-navbar-nav">
                    <Nav className="mr-auto">
                       
                    </Nav>
                    <Form inline >
                        <Button href="/signIn" variant="info" className="mr-sm-2" >Sign in</Button>{' '}
                        <Button href="/" variant="outline-info" className="mr-sm-2">Login</Button>
                    </Form>
                   
                </Navbar.Collapse>
            </Navbar>
        </div>
    </div>;
}
export default NavbarTitle;
